 const  [printItem , getPItem ] = useState([]);

  const addEvent = (pass) => {
   getItem(pass.target.value);
  }
  const PrintItemF = () => {
    getPItem((prevval) => {
      return [...prevval , addItem ]
    });
    getItem(null)

  }
return (
  <div className="main-div">
    <div className="center-div">
      <h1>ToDo list</h1>
      <input 
       type="text" 
       placeholder="add an item" 
       onChange={addEvent} 
       value={addItem}
       />
      <button on onClick={PrintItemF}> + </button>
      <ol>
        {
          props.printItem.map((val) => {
           <ToDolist
            text = {val}/>
          })
        }
       </ol>

    </div>
  </div>
)


}
